import React from 'react';
import Productos from './productos.js';
import footer from './footer.js'

class Aplicacion extends React.Component{
    render() {
        return (
            <div>
                <h1>Tienda Virtual</h1>
                <Productos />
                <footer />
            </div>

        )
    }
}

export default Aplicacion;
